const TableData = () => {
   
    let users;
    useEffect(() => {
        
        fetch('/about')
            .then(res => res.json())
            .then(async (data) => {
                await console.log(data)
                console.log('done')
            })
    }, []);

    return (

        <>
            <h1>hello from TableData</h1>
        </>
    );
};

export default TableData;
